import React from 'react';
import { Navbar, Nav, NavDropdown }from 'react-bootstrap';

function Header(){
  const HeaderGrid = {
    display: 'grid',
    gridTemplateColumns: '1fr 1fr',
    borderTop: '8px solid #210124',
    borderBottom: '8px solid #210124',
    backgroundColor: '#E5FCF5'
  }
  const btnStyle = {
    backgroundColor: '#210124',
    borderColor: '#210124',
    color: 'white',
    fontWeight: 'bold'
  }



  return (
    <>
    <Navbar style={HeaderGrid}>
      <Navbar.Brand href="#home" className="tavernName">MS Journal</Navbar.Brand>
      <div id="header">
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#medhistory">My Medical History</Nav.Link>
            <NavDropdown title="Kegmeisters Only" id="basic-nav-dropdown">
              <NavDropdown.Item href="#admin">Admin Area</NavDropdown.Item>
              <NavDropdown.Item href="#newkegform">Add Keg</NavDropdown.Item>
              <NavDropdown.Item href="#editkegform">Edit Keg List</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </div>
    </Navbar>
    </>
);
}

export default Header;
